import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M16 17.5a.5.5 0 001 0v-15a.5.5 0 00-1 0v15zM10 4a2 2 0 00-2 2v8c0 1.1.9 2 2 2h2a2 2 0 002-2V6a2 2 0 00-2-2h-2z", fill: primaryFill }));
};
const AlignEndHorizontal20Filled = wrapIcon(rawSvg({}), 'AlignEndHorizontal20Filled');
export default AlignEndHorizontal20Filled;
